import React, { useRef, useEffect } from "react";
import { useSpring, animated, to } from "@react-spring/web";
import { useGesture } from "react-use-gesture";
import { Container, Typography, Grid, Card, CardContent } from "@mui/material";

const skillsData = [
  { category: "Language", skills: ["JavaScript", "Java", "C", "Python", "TypeScript", "R"] },
  { category: "Markup", skills: ["HTML5", "CSS3"] },
  { category: "Data", skills: ["MySQL", "JSON"] },
  { category: "Framework", skills: ["React", "React-Native", "FastAPI", "Node.js"] },
  { category: "Tool", skills: ["Postman", "Git", "Github", "Linux", "Jira"] },
  { category: "Design", skills: ["Figma"] },
];
const calcX = (y, ly) => -(y - ly - window.innerHeight / 2) / 20;
const calcY = (x, lx) => (x - lx - window.innerWidth / 2) / 20;
// ... (imports)

const AnimatedCard = ({ skill, index, categoryIndex }) => {
    const [{ x, y, rotateX, rotateY, rotateZ, zoom, scale }, springApi] = useSpring(() => ({
        rotateX: 0,
        rotateY: 0,
        rotateZ: 0,
        scale: 1,
        zoom: 0,
        x: 0,
        y: 0,
        config: { mass: 5, tension: 350, friction: 40 },
    }));

    const animatedStyle = {
        transform: "perspective(600px)",
        x,
        y,
        scale: to([scale, zoom], (s, z) => s + z),
        rotateX,
        rotateY,
        rotateZ,
    };

    useEffect(() => {
        springApi.start({
            rotateX: 0,
            rotateY: 0,
            rotateZ: 0,
            scale: 1,
        });
    }, [springApi]);

    return (
        <animated.div
            ref={(el) => (domTargets.current[categoryIndex + index] = el)}
            style={animatedStyle}
        >
            <Card variant="outlined">
                <CardContent>
                    <Typography variant="body1" fontWeight={"bold"} textAlign={"center"}>
                        {skill}
                    </Typography>
                </CardContent>
            </Card>
        </animated.div>
    );
};

const Skill = () => {
    const domTargets = useRef([]);

    const [{ wheelY }, wheelApi] = useSpring(() => ({ wheelY: 0 }));

    useGesture(
        {
            onWheel: ({ event, offset: [, y] }) => {
                event.preventDefault();
                wheelApi.set({ wheelY: y });
            },
        },
        { eventOptions: { passive: false } }
    );

    useEffect(() => {
        const preventDefault = (e) => e.preventDefault();
        document.addEventListener("gesturestart", preventDefault);
        document.addEventListener("gesturechange", preventDefault);

        return () => {
            document.removeEventListener("gesturestart", preventDefault);
            document.removeEventListener("gesturechange", preventDefault);
        };
    }, []);

    return (
        <Container
            id="intro"
            sx={{
                display: "flex",
                flexDirection: "column",
                alignItems: "center",
                justifyContent: "center",
                height: "100%",
            }}
        >
            <Typography variant="h4" fontWeight={"bold"} align="center" mb={5}>
                Skills
            </Typography>

            <Grid container spacing={1}>
                {skillsData.map((category, categoryIndex) => (
                    <Grid item key={categoryIndex} xs={12} sm={6} md={4}>
                        <Typography variant="h6" color={"GrayText"} mb={2} textAlign={"center"}>
                            {category.category}
                        </Typography>

                        <Grid container spacing={1}>
                            {category.skills.map((skill, skillIndex) => (
                                <Grid item key={skillIndex} xs={5} sm={4} md={6}>
                                    <AnimatedCard
                                        skill={skill}
                                        index={skillIndex}
                                        categoryIndex={categoryIndex}
                                    />
                                </Grid>
                            ))}
                        </Grid>
                    </Grid>
                ))}
            </Grid>
        </Container>
    );
};

export default Skill;
